import React from 'react'

const Employees = ({ employees }) => {
  return (
    <div width="100%">
      <center><h1>Employee List</h1></center>
      <table width="100%">
      <tr background-color="red"><td width="20%">Code</td><td width="20%">Name</td><td width="20%">Age</td><td width="20%">Address</td><td width="20%">Department</td></tr>
      {employees.map((employee) => (
        <tr><td width="20%">{employee.code}</td><td width="20%">{employee.name}</td><td width="20%">{employee.age}</td><td width="20%">{employee.address}</td><td width="20%">{employee.department}</td></tr>

      ))}
      </table>
    </div>
  )
};

export default Employees
